import React from 'react';
import { Form, Field } from 'react-final-form';
import { getTrashTypes, sendSubmission } from '../../api';
import { RootWrapper, Wrapper } from './StartView.styled';
import { Geolocation } from './Geolocation';
import { Button } from './Button';
import { ImageUpload } from './ImageUpload';
import { Dropdown } from './Dropdown';

const onSubmit = async (values: any) => {
  let image = `data:image/jpeg;base64,`;

  const trashType = (trash: string) => {
    if (trash === 'Bike') {
      return 1;
    }
    if (trash === 'Car') {
      return 2;
    }
    if (trash === 'Heavy Trash') {
      return 3;
    }
    if (trash === 'Other') {
      return 4;
    }
    return 1;
  };

  await sendSubmission({
    location: {
      latitude: '52.1422839',
      longitude: '20.9012627',
    },
    image,
    type_of_trash: trashType(values.trashType),
  });

  console.log({ ...values, image });
};

export class StartView extends React.Component<{}, { trashTypes: any }> {
  constructor(props: {}) {
    super(props);
    this.state = { trashTypes: {} };
  }

  async componentDidMount() {
    const trashTypes = await getTrashTypes();
    this.setState({ trashTypes: trashTypes.data['type_of_trash'] });
  }

  render() {
    return (
      <RootWrapper>
        <Wrapper>
          <Form
            onSubmit={onSubmit}
            render={({ handleSubmit, form, submitting, pristine, values }) => (
              <form onSubmit={handleSubmit}>
                <Field name="image" component={ImageUpload} />
                <Field name="geolocation" component={Geolocation} />
                <Field
                  name="trashType"
                  render={props => (
                    <Dropdown
                      {...props.input}
                      input={props.input}
                      meta={props.meta}
                      elements={this.state.trashTypes}
                    />
                  )}
                />
                <Button type="submit">Submit</Button>
              </form>
            )}
          />
        </Wrapper>
      </RootWrapper>
    );
  }
}
